export default class WelcomeDistributor extends Component {
render() {
  
  var user = [JSON.parse(localStorage.getItem("username"))];

  return (
    
<div>
  <welcome>
  <strong>Welcome {user} </strong>
  </welcome> 


 <ul className="ul_top_hypers">
            <li>
                <NavLink className="nav-link" to="/PacksToDistribute">See Distributions awaiting    </NavLink>
            </li>
  </ul>
   


  </div> 

  

);
  }
}
